import React from 'react';
import Header from '../../components/Header';
import Sidebar from '../../components/Sidebar';
import './PatientDashboard.css';

const PatientDashboard = () => {
  // Simulated logged-in user (replace with AuthContext in real project)
  const user = JSON.parse(localStorage.getItem('user')) || { name: 'Patient', role: 'patient' };

  const handleLogout = () => {
    localStorage.clear();
    window.location.href = '/';
  };

  // Mock upcoming appointments
  const appointments = [
    { id: 1, doctor: 'Dr. Alice Uwase', department: 'Cardiology', datetime: '2025-11-03 09:00', status: 'Scheduled' },
    { id: 2, doctor: 'Dr. John Niyonsenga', department: 'General Medicine', datetime: '2025-11-05 11:00', status: 'Scheduled' }
  ];

  // Mock recent medical records
  const records = [
    { id: 1, type: 'Blood Test', doctor: 'Dr. Alice Uwase', date: '2025-10-20', notes: 'Normal' },
    { id: 2, type: 'X-Ray', doctor: 'Dr. John Niyonsenga', date: '2025-10-15', notes: 'Minor fracture' }
  ];

  return (
    <div className="dashboard-container">
      <Header user={user} onLogout={handleLogout} />
      <Sidebar role={user.role} />

      <main className="dashboard-content">
        <h2>Welcome, {user.name}</h2>

        {/* Upcoming Appointments */}
        <section className="card-section">
          <h3>Upcoming Appointments</h3>
          <table className="appointments-table">
            <thead>
              <tr>
                <th>#</th>
                <th>Doctor</th>
                <th>Department</th>
                <th>Date & Time</th>
                <th>Status</th>
              </tr>
            </thead>
            <tbody>
              {appointments.map((appt) => (
                <tr key={appt.id}>
                  <td>{appt.id}</td>
                  <td>{appt.doctor}</td>
                  <td>{appt.department}</td>
                  <td>{appt.datetime}</td>
                  <td>{appt.status}</td>
                </tr>
              ))}
            </tbody>
          </table>
        </section>

        {/* Medical Records */}
        <section className="card-section">
          <h3>Recent Medical Records</h3>
          <table className="records-table">
            <thead>
              <tr>
                <th>#</th>
                <th>Type</th>
                <th>Doctor</th>
                <th>Date</th>
                <th>Notes</th>
              </tr>
            </thead>
            <tbody>
              {records.map((rec) => (
                <tr key={rec.id}>
                  <td>{rec.id}</td>
                  <td>{rec.type}</td>
                  <td>{rec.doctor}</td>
                  <td>{rec.date}</td>
                  <td>{rec.notes}</td>
                </tr>
              ))}
            </tbody>
          </table>
        </section>
      </main>
    </div>
  );
};

export default PatientDashboard;
